function Footer() {
  return (
    <>
      <section
        style={{
          minHeight: "98vh",
          display: "flex",
          flexDirection: "column",
          bottom: "0",
          width: "100%",
          backgroundColor:
            "#333" /* Change to your preferred background color */,
          color: "#fff" /* Change to your preferred text color */,
          textAlign: "center",
          padding: "10px",
        }}
      >
        <h1>this is footer</h1>
      </section>
    </>
  );
}
export default Footer;
